import React from 'react';

const Card = () => {
    return (
        <div>
            <h1>RoboFriends</h1>
            <div>
                <img src='https://robohash.org/test?200x200' alt='Robot'></img>
                <div>
                    <h2>Robot Robotov</h2>
                    <p>robot@gmail.com</p>
                </div>
            </div>
        </div>
    )
}

export default Card;
